kind = msg.kind
x = msg.x
y = msg.y
z = msg.z
subscription = msg.subscription if msg.HasField('subscription') else None
if not subscription:
    class_ = {RATE: RateReply, ACCELERATION: AccelerationReply, POSE: PoseReply
        }[kind]
    return class_(x, y, z)
else:
    class_ = {RATE: RateUpdate, ACCELERATION: AccelerationUpdate, POSE:
        PoseUpdate}[kind]
    return class_(x, y, z, subscription)
